import React from 'react';

function EmployeeList({ employees }) {
  return (
    <div>
      <ul>
        {employees.map((employee, index) => (
          <li key={index}>
            {employee.name} - {employee.position}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default EmployeeList;
